import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click the "Your Profile" link to navigate to the profile section
    // Using getByText and selecting the first instance as there are multiple
    await page.getByText('Your Profile', { exact: true }).first().click();

    // Wait for the profile page content to be loaded and visible
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take a screenshot of the profile page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const fullName = await page.locator('.profile-info h2').textContent();
    const username = await page.locator('p.username').textContent();
    const bio = await page.locator('p.bio').textContent();
    const totalOrders = await page.locator('.profile-stats .stat-number').nth(0).textContent();
    const totalReviews = await page.locator('.profile-stats .stat-number').nth(1).textContent();
    const sellerRating = await page.locator('.profile-stats .stat-number').nth(2).textContent();

    const extractedData = {
      fullName: fullName.trim(),
      username: username.trim(),
      bio: bio.trim(),
      stats: {
        totalOrders: parseInt(totalOrders, 10),
        totalReviews: parseInt(totalReviews, 10),
        sellerRating: parseFloat(sellerRating)
      }
    };

    return {
      success: true,
      action: "Successfully navigated to the user profile page and extracted key information.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
